import React from "react";
import logo from "./logo.svg";
import { Counter } from "./features/jobSlice/Counter";
import "./App.css";
import Job from "./Job/Job";
import { Provider } from "react-redux";
import { store } from "./app/store";

function App() {
  return (
    <Provider store={store}>
      <div className="App">
        <Job />
      </div>
    </Provider>
  );
}

export default App;
